import React, { Component } from 'react';
import './Panel.css';


export default class Panel extends Component {

    constructor() {
        super();
        this.state = {
            showing: "bodywork",
            showing1: "",
            showing2: "",
            showing3: "",
        };
    }

    render() {

        var left = (this.state.showing1);
        var rightHeading = (this.state.showing2);
        var rightText = (this.state.showing3);

        return (
            <div className="whole-thing">
                <div className="panel-wrap">
                    <div className="intro-text"><span className="span">Therapeutic Massage </span> <br></br> by <br></br> <span className="span">Name</span></div>
                    <div className="border"></div>

                    <div className="panel">
                        <div className="panel-left">
                            <p ref="leftImage">{left} </p>
                        </div>
                        <div className="panel-right">
                            <h2 ref="panelHeading">{rightHeading}</h2>
                            <p ref="textBody">{rightText}</p>
                        </div>}
            </div>



                    <div className="navbar-wrap">
                        <div className="navbar">

                            <button className="bodywork" onClick={() => {
                                this.setState({ showing: "bodywork" });
                                this.setState({ showing1: "figure out how to put picture here" });
                                this.setState({ showing2: "Bodywork" });
                                this.setState({ showing3: "Lorem ipsum dolor amet" });
                            }} >Bodywork</button>



                            <button className="energetic" onClick={() => {
                                this.setState({ showing: "energetic" });
                                this.setState({ showing1: "Picture"});
                                this.setState({ showing2: "energetic heading"});
                                this.setState({ showing3: "Paragraph for energetic"});
                            }} >Energetic Therapy</button>





                            <button className="scheduling" onClick={() => {
                                this.setState({ showing: "scheduling" });
                                this.setState({ showing1: "Picture"});
                                this.setState({ showing2: "Schedule Now"});
                                this.setState({ showing3: "Scheduling is "});
                            }} >Scheduling</button>




                            <button className="location" onClick={() => {
                                this.setState({ showing: "location" });
                                this.setState({ showing1: "Picture"});
                                this.setState({ showing2: "energetic heading"});
                                this.setState({ showing3: "Paragraph for energetic"});
                            }}>Office Location</button>

                            <button className="therapist" onClick={() => {
                                this.setState({ showing: "therapist" });
                                this.setState({ showing1: "Picture"});
                                this.setState({ showing2: "energetic heading"});
                                this.setState({ showing3: "Paragraph for energetic"});
                            }}>Your Therapist</button>

                        </div>


                        <div className="footer-wrap">
                            <div className="footer">
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
